_DESCRIPTION_:
Panasonic WV-CP630/G представляют собой корпусную цветную видеокамеру без объектива с разрешением 700 ТВЛ, предназначенную для эксплуатации при температурах от -10 до +50 в любых условиях освещения благодаря функции «День/Ночь» с электромеханическим ИК-фильтром.
CCD-матрица размером 1/3” имеет разрешение 976х582p и высокую светочувствительность. Корпусная видеокамера наблюдения Panasonic WV-CP630/G  формирует цветное изображение при минимальной освещенности в 0,08 Лк, а черно-белое – при 0,008 Лк. Естественности цветовых оттенков изображения способствует 3-мерная функция преобразования цвета, а высокую детализацию изображения даже в темных участках сцены обеспечивает технология Adaptive Black Stretch.
Для оснащения аналоговой видеокамеры Panasonic WV-CP630/G объективами предусмотрено CS-крепление. Производитель рекомендует использовать вариообъективы с автоматической регулировкой диафрагмы, управляемой постоянным током (DC).

Для получения в любое время суток четкого реалистичного высокоинформативного изображения камера Панасоник используют следующие функции и технологии: 
автоматический баланс белого AWB;
технологию расширенного динамического диапазона Super Dynamic 6;
адаптивное цифровое подавление шумов (2D-DNR+3D-DNR);
автоматическую стабилизацию изображения;
технологию автоматического управления мощностью светового потока;
функцию Auto Back Focus. 

Помимо этого Panasonic WV-CP630/G наделён возможностью видео обнаружения движения, цифрового увеличения изображения (2х), наложению масок приватности (2 области наблюдаемой сцены). Дополнительно можно подключить датчик тревоги и исполнительное (сигнальное) устройство.
Настройка параметров работы камеры и управление производится через мультиязычное (в том числе и русский язык) экранное меню.
Для Panasonic WV-CP630/G предусмотрено питание только от промышленной сети переменного тока 220~240В.

